import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom';
import { Button } from 'antd'
import {sendPostRequest} from '../utils/utils'

export default function Dashboard() {
    const navigate = useNavigate()
    useEffect(()=>{
        sendPostRequest()
    },[])
    return (
        <>
            <Button onClick={() => {
                navigate('/Detail')
            }}>跳转</Button>
        </>
    )
}
